import React from "react";
import {Chart} from 'primereact/chart';

export default function Pie3() {

  const data = {
    datasets: [
        {
            data: [600,1280],
            backgroundColor: [
                "#FF6384"
            ],
            hoverBackgroundColor: [
                "#FF6384"
            ]
        }]
    };
    return (
      <div>
      <Chart width="50" height="50" type="pie" data={data} />
  </div>
    );
  }
